/* eslint-disable */

function addAvenirNextLTProRegularFont(jsPDFAPI) {
  var font = '';
  var callAddFont = function() {
    this.addFileToVFS('AvenirNextLTProRegular.ttf', font);
    this.addFont('AvenirNextLTProRegular.ttf', 'avenir', 'normal');
  };
  jsPDFAPI.events.push(['addFonts', callAddFont]);
}

export default addAvenirNextLTProRegularFont;
